import React from 'react';
import './Image-slideshow.css'

function SlideShow()
{
    return(
        <section className='conyainer'>
            <div className='slide-wrapper'>
                <div className='slider'>
                    <img id='slide-1' src='https://www.etisalat.eg/shopmedia/MEDIA_ProductCatalog/CONTENTITEMS_2383_Emerald-banner-EN_c04e5a50.jpg' alt=''/>
                    <img id='slide-2' src='https://scontent.fcai20-2.fna.fbcdn.net/v/t39.30808-6/369795403_685285470308741_6224046853657242457_n.jpg?stp=dst-jpg_s960x960&_nc_cat=107&ccb=1-7&_nc_sid=e3f864&_nc_eui2=AeHE6K0YriIsMvpuVNjHcgncvLMfMo46RYW8sx8yjjpFhbW6Ix5Am7SB4CQwhqh5CSoQFI2FpV61lPUc8qzftzVr&_nc_ohc=He4PfcV3s_0AX-XidJu&_nc_ht=scontent.fcai20-2.fna&oh=00_AfAyoZW-_QIcZ2GeKdObOYK2pToVLu91XnQSASKtk7vDrQ&oe=64EF0F4F' alt=''/>
                    <img id='slide-3' src='https://mir-s3-cdn-cf.behance.net/projects/404/82eedc172266317.Y3JvcCw4OTQsNzAwLDAsMA.jpg' alt=''/>
                </div>
                <div className='slider-nav'>
                    <a href='#slide-1'/>
                    <a href='#slide-2'/>
                    <a href='#slide-3'/>
                </div>
            </div>
        </section>
    );
}
export default SlideShow;
